import React from 'react';

function Header() {
  return (
    <header className="bg-blue-600 text-white p-4">
      <div className="container mx-auto">
        <h1 className="text-2xl font-bold">Expense Tracker</h1>
      </div>
    </header>
  );
}

export default Header;
